package com.led.player.po;

public class GPSLoopVideoPo {
	public int _videoproportion;
	public int _voicevalue;
	public String _filepath;
	public String _begintime;
	public GPSLoopVideoPo() {
		// TODO Auto-generated constructor stub
	}
	
	public GPSLoopVideoPo(int _videoproportion, int _voicevalue, String _filepath,
			String _begintime) {
		super();
		this._videoproportion = _videoproportion;
		this._voicevalue = _voicevalue;
		this._filepath = _filepath;
		this._begintime = _begintime;
	}

	@Override
	public String toString() {
		return "VideoVo [_videoproportion=" + _videoproportion
				+ ", _voicevalue=" + _voicevalue + ", _filepath=" + _filepath
				+ ", _begintime=" + _begintime + "]";
	}
	public int get_videoproportion() {
		return _videoproportion;
	}
	public void set_videoproportion(int _videoproportion) {
		this._videoproportion = _videoproportion;
	}
	public int get_voicevalue() {
		return _voicevalue;
	}
	public void set_voicevalue(int _voicevalue) {
		this._voicevalue = _voicevalue;
	}
	public String get_filepath() {
		return _filepath;
	}
	public void set_filepath(String _filepath) {
		this._filepath = _filepath;
	}
	public String get_begintime() {
		return _begintime;
	}
	public void set_begintime(String _begintime) {
		this._begintime = _begintime;
	}
	
	
	
}
